import React, { useState } from 'react';
import { doctorAPI } from '../../api/endpoints';
import VitalSignsForm from '../VitalSigns/VitalSignsForm';

const EyeConsultationForm = ({ patientId, onSave }) => {
  const [formData, setFormData] = useState({
    rightEye: {
      visualAcuity: '',
      cornea: '',
      lens: '',
      retina: '',
      intraocularPressure: '',
      refraction: ''
    },
    leftEye: {
      visualAcuity: '',
      cornea: '',
      lens: '',
      retina: '',
      intraocularPressure: '',
      refraction: ''
    },
    diagnosis: '',
    prescription: '',
    notes: '',
    amount: ''
  });

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const consultationData = {
        patient_id: patientId,
        symptoms: `Right Eye: VA ${formData.rightEye.visualAcuity}, Cornea ${formData.rightEye.cornea}. Left Eye: VA ${formData.leftEye.visualAcuity}, Cornea ${formData.leftEye.cornea}`,
        diagnosis: formData.diagnosis,
        prescription: formData.prescription,
        notes: formData.notes,
        amount: formData.amount
      };

      await doctorAPI.saveConsultation(consultationData);
      // Consultation saved successfully
      onSave && onSave();
    } catch (error) {
      console.error('Failed to save consultation');
    }
  };

  return (
    <div className="consultation-form">
      <h3>üëÅ Eye Examination</h3>

      <VitalSignsForm patientId={patientId} onSave={() => {}} />

      <form onSubmit={handleSubmit}>
        <div className="eye-sections">
          <div className="eye-section">
            <h4>Right Eye (OD)</h4>
            <input type="text" placeholder="Visual Acuity" value={formData.rightEye.visualAcuity} onChange={(e) => setFormData({...formData, rightEye: {...formData.rightEye, visualAcuity: e.target.value}})} />
            <input type="text" placeholder="Cornea" value={formData.rightEye.cornea} onChange={(e) => setFormData({...formData, rightEye: {...formData.rightEye, cornea: e.target.value}})} />
            <input type="text" placeholder="Lens" value={formData.rightEye.lens} onChange={(e) => setFormData({...formData, rightEye: {...formData.rightEye, lens: e.target.value}})} />
            <input type="text" placeholder="Retina" value={formData.rightEye.retina} onChange={(e) => setFormData({...formData, rightEye: {...formData.rightEye, retina: e.target.value}})} />
          </div>
          <div className="eye-section">
            <h4>Left Eye (OS)</h4>
            <input type="text" placeholder="Visual Acuity" value={formData.leftEye.visualAcuity} onChange={(e) => setFormData({...formData, leftEye: {...formData.leftEye, visualAcuity: e.target.value}})} />
            <input type="text" placeholder="Cornea" value={formData.leftEye.cornea} onChange={(e) => setFormData({...formData, leftEye: {...formData.leftEye, cornea: e.target.value}})} />
            <input type="text" placeholder="Lens" value={formData.leftEye.lens} onChange={(e) => setFormData({...formData, leftEye: {...formData.leftEye, lens: e.target.value}})} />
            <input type="text" placeholder="Retina" value={formData.leftEye.retina} onChange={(e) => setFormData({...formData, leftEye: {...formData.leftEye, retina: e.target.value}})} />
          </div>
        </div>
        <textarea placeholder="Diagnosis" value={formData.diagnosis} onChange={(e) => setFormData({...formData, diagnosis: e.target.value})} required />
        <textarea placeholder="Prescription" value={formData.prescription} onChange={(e) => setFormData({...formData, prescription: e.target.value})} />
        <textarea placeholder="Notes" value={formData.notes} onChange={(e) => setFormData({...formData, notes: e.target.value})} />
        <input type="number" placeholder="Amount (KSH)" value={formData.amount} onChange={(e) => setFormData({...formData, amount: e.target.value})} required />
        <button type="submit">Save Consultation</button>
      </form>
    </div>
  );
};

export default EyeConsultationForm;
